export default function Greetings(){

    function generateGreetings(){
        let hour = new Date().getHours();
        let greetings = "";

        if(hour >= 0 && hour < 12)
            greetings = "Good Morning";
        else if(hour >= 12 && hour < 17)
            greetings = "Good Afternoon";
        else
            greetings = "Good Evening";

        return greetings;
    }

    return(
        <>
            <h1>{generateGreetings()}</h1>
        </>
    )
}
